  padding: 20,
  border: '1px solid #DDD',
  height: 150,
};

const PhraseLayout = props => (
  <div>
    <div style={layoutStyle}>
      <Phrase />
      {props.children}
    </div>
  </div>
);

export default PhraseLayout;
